function GetCookie(e){const o=`${e}=`,t=document.cookie.split(";");for(let e=0;e<t.length;e++){if(0===t[e].trim().indexOf(o))return"here"}return null}function testFirstCookie(){null==GetCookie("FirstTimeVisitCookie")||"serviceWorker"in navigator&&navigator.serviceWorker.getRegistrations().then((e=>{for(const o of e)o.unregister()})),console.log("new visitor")}$(document).ready((()=>{testFirstCookie()}));